import { styled } from "styled-components";

import Menu from "./Menu";
import SBLogo from "./SBLogo";
import SBMyMarket from "./SBMyMarket";
import SBSell from "./SBSell";
import SBTalk from "./SBTalk";
import SearchBar from "./SearchBar";
import Sellcenter from "./SellCenter";

const SBContainerDiv = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  font-family: "Noto Sans KR", sans-serif;
  font-size: 14px;
  color: #212121;
  border-bottom: 1px solid #e4e0e0;
`;

const SearchBarDiv = styled.div`
  display: flex;
  width: 1024px;
  justify-content: space-around;
  box-sizing: border-box;
  padding-top: 35px;
`;

const SBContentContainer = styled.div`
  display: flex;
  box-sizing: border-box;
  align-items: center;
`;

const SBContentContainer2 = styled.div`
  display: flex;
  box-sizing: border-box;
  align-items: center;
`;

const MenuContainer = styled.div`
  display: flex;
  align-items: center;
  width: 1024px;
  height: 70px;
`;

const SBContainer = () => {
  return (
    <SBContainerDiv>
      <SearchBarDiv>
        <SBContentContainer>
          <SBLogo></SBLogo>
        </SBContentContainer>
        <SBContentContainer>
          <SearchBar></SearchBar>
        </SBContentContainer>
        <SBContentContainer2>
          <SBSell />
          <SBMyMarket />
          <SBTalk />
        </SBContentContainer2>
      </SearchBarDiv>
      <MenuContainer>
        <Menu />
        <Sellcenter />
      </MenuContainer>
    </SBContainerDiv>
  );
};

export default SBContainer;
